import React from 'react';
import {Router,Switch} from 'react-router-dom';
import About from './About';
import Contact from './Contact';

const App = ()=>{
     return (
          <>
          <Switch>
               <Route exact path='/' component={About}/>
          </Switch>
              <About />
              <Contact />
          </>
     )
}

export default App;
